import { AppBar, Box, Toolbar, Button, IconButton } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { Link } from 'react-router-dom';
import { ReactComponent as BeautySupplyLogo } from '../assets/beauty_supply_logo2.svg';

const Nav = () => {

  return (
    <Box sx={{ flexGrow: 1, mb: 8 }} aria-label="Navigation bar">
      <AppBar position="static" sx={{ backgroundColor: 'rgb(12	88	212	)' }}>
        <Toolbar>
          <IconButton size="large" edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
            <MenuIcon />
          </IconButton>
          <Box sx={{ flexGrow: 1, ml: 5 }} aria-label="">
            <Link to="/">
              <BeautySupplyLogo style={{ width: '200px', height: 'auto', marginTop: '5px' }} />
            </Link>
          </Box>
          <Link to="/cart">
            <IconButton size="large" edge="start" color="inherit" aria-label="cart" sx={{ mr: 2 }}>
            <ShoppingCartIcon />
          </IconButton>
          </Link>
        </Toolbar>
      </AppBar>
    </Box>
  );
};

export default Nav;
